import React, { useState } from 'react';

const App = () => {
    // State to toggle visibility of product items
    const [showProducts, setShowProducts] = useState(false);

    // Function to toggle the product items visibility
    const toggleProducts = () => {
        setShowProducts(!showProducts);
    };

    return (
        <div>
            <header>
                <div className="nav-buttons">
                    <button>Home</button>
                    <button>Products <span onClick={toggleProducts} style={{ cursor: 'pointer' }}>â–¼</span></button>
                    <button>Pricing</button>
                </div>

                {/* User Profile Section */}
                <div className="user-profile">
                    <img src="https://thumbs.dreamstime.com/b/profile-pic-icon-isolated-white-background-your-web-mobile-app-design-133862807.jpg" alt="User Avatar" className="avatar" />
                    <span className="username">Chinmay</span>
                </div>
            </header>

            <main>
                <h1>Welcome to My React App</h1>

                {/* Demo and Sign Up Buttons below the heading */}
                <div className="action-buttons">
                    <button className="demo-btn">Demo</button>
                    <button className="signup-btn">Sign Up</button>
                </div>

                {/* Conditionally render product items based on showProducts state */}
                {showProducts && (
                    <div className="product-list">
                        <ul>
                            <li>Product 1</li>
                            <li>Product 2</li>
                            <li>Product 3</li>
                        </ul>
                    </div>
                )}
            </main>
        </div>
    );
};

export default App;
